document.addEventListener('DOMContentLoaded', function() {
    // Configurações (agora mais seguras)
    const config = {
        precos: {
            molduras: { pequeno: 150, medio: 120, grande: 90 },
            paredes: 85,
            forros: 75
        },
        fotos: [
            {
                url: 'https://imgur.com/pQbNmb9.jpg',
                categoria: 'Molduras',
                descricao: 'Moldura clássica em gesso'
            }
            // Adicione mais fotos conforme necessário
        ],
        admin: {
            email: "iguinho20165@gmail.com",  // Idealmente isso viria de variáveis de ambiente
            notificar: true
        },
        emailjs: {
            serviceId: 'service_2xek65s',     // Mover para variáveis de ambiente
            templateId: 'template_he6hr6l',  // Mover para variáveis de ambiente
            userId: 'FsT8bpRAgUImo7H0a'      // Mover para variáveis de ambiente
        }
    };

    // Elementos DOM
    const elements = {
        bgAnimation: document.getElementById('bgAnimation'),
        optionCards: document.querySelectorAll('.option-card'),
        formulario: document.getElementById('formulario'),
        galeria: document.getElementById('galeria'),
        galleryGrid: document.getElementById('galleryGrid'),
        modal: document.getElementById('resultModal'),
        closeModalBtn: document.getElementById('closeModal'),
        exportPdfBtn: document.getElementById('exportPdf'),
        sendWhatsappBtn: document.getElementById('sendWhatsapp'),
        voltarModalBtn: document.getElementById('voltarModal'),
        inputsDinamicos: document.getElementById('inputsDinamicos'),
        formTitle: document.getElementById('form-title'),
        resultText: document.getElementById('resultText'),
        budgetForm: document.getElementById('budget-form'),
        btnVoltarGaleria: document.getElementById('btnVoltarGaleria'),
        lightbox: document.getElementById('lightbox'),
        lightboxImg: document.getElementById('lightbox-img'),
        lightboxCaption: document.getElementById('lightbox-caption'),
        adminButton: document.getElementById('adminButton'),
        adminPanel: document.getElementById('adminPanel'),
        closeAdmin: document.getElementById('closeAdmin'),
        totalOrcamentos: document.getElementById('totalOrcamentos'),
        adminTableBody: document.getElementById('adminTableBody')
    };

    // Estado da aplicação
    const state = {
        orcamentoAtual: null,
        pdfBlob: null,
        orcamentos: JSON.parse(localStorage.getItem('orcamentos_molduart')) || [],
        adminSenha: "280401igor"  // Idealmente isso seria solicitado no primeiro acesso ou configurado externamente
    };

    // Inicialização
    function init() {
        createBackgroundAnimation();
        setupEventListeners();
        loadGallery();
        atualizarPainelAdmin();
        
        // Inicializa EmailJS (se estiver disponível)
        if (typeof emailjs !== 'undefined') {
            emailjs.init(config.emailjs.userId);
        }
    }

    // Animação de fundo
    function createBackgroundAnimation() {
        for (let i = 0; i < 15; i++) {
            const circle = document.createElement('div');
            circle.classList.add('bg-circle');
            
            circle.style.width = `${Math.random() * 200 + 50}px`;
            circle.style.height = circle.style.width;
            circle.style.left = `${Math.random() * 100}%`;
            circle.style.animationDelay = `${Math.random() * 15}s`;
            circle.style.animationDuration = `${Math.random() * 20 + 10}s`;
            
            elements.bgAnimation.appendChild(circle);
        }
    }

    // Configuração de eventos
    function setupEventListeners() {
        // Cards de opção
        elements.optionCards.forEach(card => {
            card.addEventListener('click', () => {
                const opcao = card.getAttribute('data-opcao');
                if (opcao === 'galeria') {
                    showGallery();
                } else {
                    selecionarOpcao(opcao);
                }
            });
        });

        // Modal
        elements.closeModalBtn.addEventListener('click', closeModal);
        elements.voltarModalBtn.addEventListener('click', voltarModal);
        elements.exportPdfBtn.addEventListener('click', exportToPdf);
        elements.sendWhatsappBtn.addEventListener('click', enviarWhatsApp);
        elements.btnVoltarGaleria.addEventListener('click', showOptions);
        
        // Lightbox
        document.querySelector('.close-lightbox').addEventListener('click', closeLightbox);
        elements.lightbox.addEventListener('click', (e) => {
            if (e.target === elements.lightbox) {
                closeLightbox();
            }
        });
        
        // Admin
        elements.adminButton.addEventListener('click', mostrarLoginAdmin);
        elements.closeAdmin.addEventListener('click', () => {
            elements.adminPanel.style.display = 'none';
        });

        // Teclado
        document.addEventListener('keydown', (e) => {
            if (e.key === 'Escape' && elements.lightbox.style.display === 'flex') {
                closeLightbox();
            }
        });
    }

    // Navegação
    function showOptions() {
        document.querySelector('.options-container').style.display = 'grid';
        elements.formulario.style.display = 'none';
        elements.galeria.style.display = 'none';
        elements.modal.style.display = 'none';
    }

    function showGallery() {
        document.querySelector('.options-container').style.display = 'none';
        elements.formulario.style.display = 'none';
        elements.galeria.style.display = 'block';
    }

    function hideOptions() {
        document.querySelector('.options-container').style.display = 'none';
        elements.formulario.style.display = 'block';
        elements.galeria.style.display = 'none';
    }

    function closeModal() {
        elements.modal.style.display = 'none';
        showOptions();
    }

    function voltarModal() {
        elements.modal.style.display = 'none';
    }

    // Galeria
    function loadGallery() {
        elements.galleryGrid.innerHTML = '';
        
        if (!config.fotos || config.fotos.length === 0) {
            console.warn('Nenhuma foto encontrada na galeria');
            return;
        }
    
        config.fotos.forEach(foto => {
            if (!foto || !foto.url) return;
            
            const item = document.createElement('div');
            item.className = 'gallery-item';
            item.innerHTML = `
                <img src="${foto.url}" alt="${foto.descricao || 'Sem descrição'}" class="gallery-img">
                <div class="gallery-caption">
                    <span class="gallery-category">${foto.categoria || 'Geral'}</span>
                </div>
            `;
            
            item.querySelector('.gallery-img').addEventListener('click', () => {
                openLightbox(foto.url, foto.descricao);
            });
            
            elements.galleryGrid.appendChild(item);
        });
    }

    function openLightbox(imgSrc, caption) {
        elements.lightbox.style.display = 'flex';
        elements.lightboxImg.src = imgSrc;
        elements.lightboxCaption.textContent = caption;
        document.body.style.overflow = 'hidden';
    }

    function closeLightbox() {
        elements.lightbox.style.display = 'none';
        document.body.style.overflow = 'auto';
    }

    // Admin
    function mostrarLoginAdmin() {
        const senha = prompt("Digite a senha de administrador:");
        if (senha === state.adminSenha) {
            elements.adminPanel.style.display = 'block';
            atualizarPainelAdmin();
        } else {
            alert("Senha incorreta!");
        }
    }

    function atualizarPainelAdmin() {
        elements.totalOrcamentos.textContent = `Total de orçamentos: ${state.orcamentos.length}`;
        elements.adminTableBody.innerHTML = '';
        
        state.orcamentos.forEach((orcamento, index) => {
            const tr = document.createElement('tr');
            tr.innerHTML = `
                <td>${orcamento.data}</td>
                <td>${orcamento.tipo}</td>
                <td>${formatCurrency(parseFloat(orcamento.valorTotal))}</td>
                <td><button class="btn" onclick="verDetalhesOrcamento(${index})">Detalhes</button></td>
            `;
            elements.adminTableBody.appendChild(tr);
        });
        
        window.verDetalhesOrcamento = (index) => {
            const orcamento = state.orcamentos[index];
            let detalhes = `Tipo: ${orcamento.tipo}\nData: ${orcamento.data}\nValor: ${formatCurrency(parseFloat(orcamento.valorTotal))}\n\n`;
            
            for (const [key, value] of Object.entries(orcamento)) {
                if (key !== 'tipo' && key !== 'data' && key !== 'valorTotal') {
                    detalhes += `${formatLabel(key)}: ${value}\n`;
                }
            }
            
            alert(detalhes);
        };
    }

    async function enviarNotificacaoAdmin(orcamento) {
        if (!config.admin.notificar || !emailjs) return;
        
        try {
            await emailjs.send(
                config.emailjs.serviceId,
                config.emailjs.templateId,
                {
                    to_email: config.admin.email,
                    tipo: orcamento.tipo,
                    valor: formatCurrency(parseFloat(orcamento.valorTotal)),
                    data: orcamento.data,
                    detalhes: JSON.stringify(orcamento, null, 2)
                }
            );
            
            console.log("✅ E-mail enviado!");
        } catch (error) {
            console.error("❌ Erro ao enviar e-mail:", error.text || error);
            salvarOrcamentoLocal(orcamento);
        }
    }

    function salvarOrcamentoLocal(orcamento) {
        state.orcamentos.push(orcamento);
        localStorage.setItem('orcamentos_molduart', JSON.stringify(state.orcamentos));
        atualizarPainelAdmin();
    }

    // Formulários
    function selecionarOpcao(opcao) {
        clearErrors();
        hideOptions();
        
        elements.inputsDinamicos.innerHTML = '';
        elements.formTitle.textContent = `Orçamento de ${capitalizeFirstLetter(opcao)}`;
        
        elements.inputsDinamicos.innerHTML = getFormTemplate(opcao);
        elements.inputsDinamicos.appendChild(createBackButton());
        
        const submitBtn = elements.inputsDinamicos.querySelector('.btn-submit');
        submitBtn?.addEventListener('click', () => validarFormulario() && calcularOrcamento(opcao));
    }

    function getFormTemplate(opcao) {
        const baseTemplate = `
            <div class="form-section">
                <h3>Informações do Cliente</h3>
                <div class="form-group">
                    <label for="nome">Nome Completo</label>
                    <input type="text" id="nome" class="form-control" required>
                </div>
                <div class="form-group">
                    <label for="telefone">Telefone</label>
                    <input type="tel" id="telefone" class="form-control" required>
                </div>
                <div class="form-group">
                    <label for="cidade">Cidade</label>
                    <input type="text" id="cidade" class="form-control" required>
                </div>
                <div class="form-group">
                    <label for="observacoes">Observações</label>
                    <textarea id="observacoes" class="form-control" rows="3"></textarea>
                </div>
            </div>
        `;

        const templates = {
            moldura: `
                <div class="form-group">
                    <label for="comprimento">Comprimento Linear (m)</label>
                    <input type="number" id="comprimento" class="form-control" min="1" step="0.01" required>
                    <div class="error-message"></div>
                </div>
                <div class="form-group">
                    <label for="tipoMoldura">Tipo De Moldura</label>
                    <select id="tipoMoldura" class="form-control" required>
                        <option value="" selected disabled hidden>Selecione a moldura</option>
                        <option value="8">8 cm</option>
                        <option value="10">10 cm</option>
                        <option value="12">12 cm</option>
                    </select>
                    <div class="error-message"></div>
                </div>
                ${baseTemplate}
                <button type="button" class="btn-submit">Calcular Orçamento</button>
            `,
            parede: `
                <div class="form-group">
                    <label for="comprimento">Comprimento (m)</label>
                    <input type="number" id="comprimento" class="form-control" step="0.01" required>
                    <div class="error-message"></div>
                </div>
                <div class="form-group">
                    <label for="altura">Altura (m)</label>
                    <input type="number" id="altura" class="form-control" step="0.01" required>
                    <div class="error-message"></div>
                </div>
                <div class="form-group">
                    <label for="tipoParede">Tipo de Parede</label>
                    <select id="tipoParede" class="form-control" required>
                        <option value="" selected disabled hidden>Selecione o tipo</option>
                        <option value="40">7,5cm</option>
                        <option value="70">9,5cm</option>
                        <option value="90">11cm</option>
                    </select>
                    <div class="error-message"></div>
                </div>
                ${baseTemplate}
                <button type="button" class="btn-submit">Calcular Orçamento</button>
            `,
            forro: `
                <div class="form-group">
                    <label for="area">Área total (m²)</label>
                    <input type="number" id="area" class="form-control" step="0.01" required>
                    <div class="error-message"></div>
                </div>
                ${baseTemplate}
                <button type="button" class="btn-submit">Calcular Orçamento</button>
            `
        };

        return templates[opcao] || '';
    }

    function createBackButton() {
        const btn = document.createElement('button');
        btn.className = 'btn-voltar';
        btn.innerHTML = '<i class="fas fa-arrow-left"></i> Voltar';
        btn.addEventListener('click', showOptions);
        return btn;
    }

    // Validação
    function validarFormulario() {
        let isValid = true;
        clearErrors();
        
        const camposObrigatorios = elements.budgetForm.querySelectorAll('[required]');
        
        camposObrigatorios.forEach(field => {
            if (field.type === 'number' && parseFloat(field.value) <= 0) {
                showError(field, 'Por favor, insira um valor positivo');
                isValid = false;
            }
            else if (field.tagName === 'SELECT' && field.value === '') {
                const errorMsg = field.nextElementSibling?.classList.contains('error-message') 
                    ? field.nextElementSibling 
                    : document.createElement('div');
                
                errorMsg.className = 'error-message';
                errorMsg.textContent = 'Por favor, selecione uma opção';
                field.classList.add('invalid');
                field.parentNode.appendChild(errorMsg);
                
                if (isValid) {
                    field.focus();
                    isValid = false;
                }
            }
            else if (!field.value.trim()) {
                showError(field, 'Por favor, preencha este campo');
                if (isValid) {
                    field.focus();
                    isValid = false;
                }
            }
        });
        
        return isValid;
    }

    function clearErrors() {
        document.querySelectorAll('.form-control').forEach(el => el.classList.remove('invalid'));
        document.querySelectorAll('.error-message').forEach(el => el.remove());
    }

    function showError(field, message) {
        const errorMsg = field.nextElementSibling?.classList.contains('error-message') 
            ? field.nextElementSibling 
            : document.createElement('div');
        
        errorMsg.className = 'error-message';
        errorMsg.textContent = message;
        field.classList.add('invalid');
        field.parentNode.appendChild(errorMsg);
    }

    // Cálculos
    function calcularOrcamento(opcao) {
        try {
            const formData = getFormData(opcao);
            const calculo = calcularValor(opcao, formData);
            
            state.orcamentoAtual = {
                tipo: capitalizeFirstLetter(opcao),
                data: new Date().toLocaleDateString('pt-BR'),
                cliente: {
                    nome: document.getElementById('nome').value,
                    telefone: document.getElementById('telefone').value,
                    cidade: document.getElementById('cidade').value,
                    observacoes: document.getElementById('observacoes').value
                },
                ...formData,
                valorTotal: calculo.total.toFixed(2)
            };
            
            if (formData.area) {
                state.orcamentoAtual.area = parseFloat(formData.area).toFixed(2);
            }
            
            exibirResultado(state.orcamentoAtual);
            generatePdf(state.orcamentoAtual);
            salvarOrcamentoLocal(state.orcamentoAtual);
            
            if (config.admin.notificar) {
                enviarNotificacaoAdmin(state.orcamentoAtual);
            }

        } catch (error) {
            console.error('Erro ao calcular orçamento:', error);
            alert('Ocorreu um erro ao calcular o orçamento. Por favor, verifique os dados e tente novamente.');
        }
    }

    function getFormData(opcao) {
        const data = {};
        
        if (opcao === 'moldura') {
            data.comprimento = parseFloat(document.getElementById('comprimento').value);
            data.tipoMoldura = document.getElementById('tipoMoldura').value + ' cm';
        }
        else if (opcao === 'parede') {
            data.comprimento = parseFloat(document.getElementById('comprimento').value);
            data.altura = parseFloat(document.getElementById('altura').value);
            data.tipoParede = document.getElementById('tipoParede').value + ' mm';
            data.area = (data.comprimento * data.altura).toFixed(2);
        } 
        else if (opcao === 'forro') {
            data.area = parseFloat(document.getElementById('area').value);
        }
        
        return data;
    }

    function calcularValor(opcao, data) {
        const result = { total: 0 };
        let valor = 0;
        
        if (opcao === 'moldura') {
            const comprimento = parseFloat(data.comprimento);
            if (comprimento < 20) valor = comprimento * config.precos.molduras.pequeno;
            else if (comprimento < 50) valor = comprimento * config.precos.molduras.medio;
            else valor = comprimento * config.precos.molduras.grande;
            result.total = valor;
        } 
        else if (opcao === 'parede') {
            result.total = parseFloat(data.area) * config.precos.paredes;
        } 
        else if (opcao === 'forro') {
            result.total = parseFloat(data.area) * config.precos.forros;
        }
        
        return result;
    }

    // Exibição de resultados
    function exibirResultado(orcamento) {
        const rows = Object.entries(orcamento)
            .filter(([key]) => key !== 'valorTotal' && key !== 'cliente')
            .map(([key, value]) => `
                <tr>
                    <td>${formatLabel(key)}</td>
                    <td>${formatValue(key, value)}</td>
                </tr>
            `).join('');
        
        // Adiciona informações do cliente separadamente
        const clienteRows = Object.entries(orcamento.cliente || {})
            .map(([key, value]) => `
                <tr>
                    <td>${formatLabel(key)}</td>
                    <td>${value || 'Não informado'}</td>
                </tr>
            `).join('');
        
        elements.resultText.innerHTML = `
            <table class="result-table">
                <thead>
                    <tr>
                        <th>Item</th>
                        <th>Valor</th>
                    </tr>
                </thead>
                <tbody>
                    ${rows}
                    ${clienteRows}
                    <tr>
                        <td>Valor Total</td>
                        <td>${formatCurrency(parseFloat(orcamento.valorTotal))}</td>
                    </tr>
                </tbody>
            </table>
            <p style="margin-top: 1rem; font-size: 0.9rem;">
                <i class="fas fa-info-circle"></i> Este valor é estimado e pode variar após avaliação técnica.
            </p>
        `;
        
        elements.modal.style.display = 'flex';
    }

    function generatePdf(orcamento) {
        try {
            // Verifica se a biblioteca está disponível
            if (typeof window.jspdf === 'undefined') {
                throw new Error('A biblioteca jsPDF não foi carregada corretamente');
            }
    
            const { jsPDF } = window.jspdf;
            const doc = new jsPDF({
                orientation: "portrait",
                unit: "mm",
                format: "a4"
            });
    
            // Cores personalizadas
            const primaryColor = [0, 102, 204]; // Azul profissional
            const secondaryColor = [230, 230, 230]; // Cinza claro
            const accentColor = [0, 102, 204]; // Laranja para destaques
    
            // --- CABEÇALHO COM LOGO ---
            doc.setFillColor(...primaryColor);
            doc.rect(0, 0, 210, 30, 'F'); // Faixa colorida no topo
            
            // SUA LOGO EM BASE64 - SUBSTITUA A STRING ABAIXO
            const logoData = 'data:image/jpeg;base64,';
            doc.addImage(logoData, 'PNG', 15, 8, 30, 20); // Posição e tamanho da logo
            
            // Título centralizado
            doc.setFontSize(20);
            doc.setTextColor(255, 255, 255);
            doc.setFont("helvetica", "bold");
            doc.text("MOLDUART", 105, 20, { align: "center" });
            
            doc.setFontSize(12);
            doc.text("Orçamento Oficial", 105, 27, { align: "center" });
    
            // --- INFORMAÇÕES DO CLIENTE ---
            doc.setFontSize(14);
            doc.setTextColor(0, 0, 0);
            doc.setFont("helvetica", "bold");
            doc.text("DADOS DO CLIENTE", 15, 45);
            
            // Linha decorativa
            doc.setDrawColor(...primaryColor);
            doc.setLineWidth(0.5);
            doc.line(15, 47, 195, 47);
    
            // Tabela de informações do cliente
            doc.autoTable({
                startY: 50,
                margin: { left: 15 },
                head: [['Item', 'Dados']],
                body: [
                    ['Nome', orcamento.cliente?.nome || 'Não informado'],
                    ['Telefone', orcamento.cliente?.telefone || 'Não informado'],
                    ['Cidade', orcamento.cliente?.cidade || 'Não informado'],
                    ['Data', orcamento.data],
                    ['Observações', orcamento.cliente?.observacoes || 'Nenhuma']
                ],
                headStyles: { 
                    fillColor: primaryColor,
                    textColor: [255, 255, 255],
                    fontStyle: 'bold',
                    cellPadding: 5
                },
                bodyStyles: {
                    cellPadding: 5
                },
                alternateRowStyles: {
                    fillColor: secondaryColor
                },
                styles: { 
                    fontSize: 10,
                    cellPadding: 5,
                    overflow: 'linebreak'
                },
                theme: 'grid'
            });
    
            // --- DETALHES DO ORÇAMENTO ---
            doc.setFontSize(14);
            doc.setFont("helvetica", "bold");
            doc.text("DETALHES DO ORÇAMENTO", 15, doc.lastAutoTable.finalY + 15);
            doc.line(15, doc.lastAutoTable.finalY + 17, 195, doc.lastAutoTable.finalY + 17);
    
            // Preparar dados para a tabela
            const body = Object.entries(orcamento)
                .filter(([key]) => !['valorTotal', 'cliente', 'data'].includes(key))
                .map(([key, value]) => [formatLabel(key), formatValue(key, value)]);
    
            // Adicionar valor total no final
            body.push(['VALOR TOTAL', formatCurrency(parseFloat(orcamento.valorTotal))]);
    
            doc.autoTable({
                startY: doc.lastAutoTable.finalY + 25,
                margin: { left: 15 },
                head: [['Descrição', 'Valor']],
                body: body,
                headStyles: { 
                    fillColor: primaryColor,
                    textColor: [255, 255, 255],
                    fontStyle: 'bold',
                    cellPadding: 5
                },
                columnStyles: {
                    1: { cellWidth: 40, halign: 'right' }
                },
                bodyStyles: {
                    cellPadding: 5
                },
                styles: { 
                    fontSize: 10,
                    cellPadding: 5,
                    overflow: 'linebreak'
                },
                theme: 'grid',
                didDrawCell: (data) => {
                    // Destacar a linha do valor total
                    if (data.row.index === body.length - 1) {
                        doc.setFillColor(...accentColor);
                        doc.rect(
                            data.cell.x,
                            data.cell.y,
                            data.cell.width,
                            data.cell.height,
                            'F'
                        );
                        doc.setTextColor(0, 0, 0);
                    }
                }
            });
    
            // --- RODAPÉ PROFISSIONAL ---
            const footerY = 280;
            doc.setFillColor(...primaryColor);
            doc.rect(0, footerY, 210, 20, 'F');
            
            doc.setFontSize(10);
            doc.setTextColor(255, 255, 255);
            doc.text("Este orçamento tem validade de 7 dias a partir da data de emissão.", 
                     105, footerY + 8, { align: "center" });
            
            doc.setTextColor(200, 200, 200);
            doc.setFontSize(8);
            doc.text("Contato: (18) 99786-8832 | molduart@gmail.com", 
                     105, footerY + 15, { align: "center" });
    
            // Número do orçamento
            doc.setFontSize(10);
            doc.setTextColor(100, 100, 100);
            doc.text(`Nº ${Date.now()}`, 195, 10, { align: "right" });
    
            state.pdfBlob = doc.output('blob');
            return doc;
        } catch (error) {
            console.error('Erro ao gerar PDF:', error);
            alert('Não foi possível gerar o PDF. Por favor, tente novamente mais tarde.');
            return null;
        }
    }
    
  
  
  
    // E modifique a função exportToPdf para:
    function exportToPdf() {
        if (!state.orcamentoAtual) return;
        
        // Verifica se a biblioteca está carregada
        if (typeof window.jspdf === 'undefined') {
            alert('A funcionalidade de PDF não está disponível no momento. Por favor, entre em contato conosco.');
            return;
        }
        
        const doc = generatePdf(state.orcamentoAtual);
        if (doc) {
            doc.save(`Orcamento_Molduart_${new Date().toISOString().slice(0,10)}.pdf`);
        }
    }

    // WhatsApp
    function enviarWhatsApp() {
        if (!state.orcamentoAtual) return;
        
        const mensagem = createWhatsAppMessage(state.orcamentoAtual);
        const whatsappUrl = `https://wa.me/5518996729549?text=${encodeURIComponent(mensagem)}`;
        
        if (navigator.share && state.pdfBlob) {
            shareWithFile(state.orcamentoAtual, mensagem);
        } else {
            window.open(whatsappUrl, '_blank');
        }
    }

    function createWhatsAppMessage(orcamento) {
        const items = Object.entries(orcamento)
            .filter(([key]) => key !== 'valorTotal' && key !== 'cliente')
            .map(([key, value]) => `*${formatLabel(key)}*: ${formatValue(key, value)}`)
            .join('\n');
        
        const clienteInfo = orcamento.cliente ? `
*Cliente*:
Nome: ${orcamento.cliente.nome}
Telefone: ${orcamento.cliente.telefone}
Cidade: ${orcamento.cliente.cidade}
${orcamento.cliente.observacoes ? `Observações: ${orcamento.cliente.observacoes}` : ''}
` : '';
        
        return `*Orçamento de ${orcamento.tipo} - Molduart*\n\n` +
            `${items}\n\n` +
            `${clienteInfo}\n` +
            `*Valor Total*: ${formatCurrency(parseFloat(orcamento.valorTotal))}\n\n` +
            `Data: ${orcamento.data}\n\n` +
            "Este orçamento tem validade de 15 dias.";
    }

    function shareWithFile(orcamento, mensagem) {
        const file = new File([state.pdfBlob], `Orcamento_Molduart_${new Date().toISOString().slice(0,10)}.pdf`, {
            type: 'application/pdf'
        });
        
        navigator.share({
            title: `Orçamento de ${orcamento.tipo} - Molduart`,
            text: mensagem,
            files: [file]
        }).catch(err => {
            console.error('Erro ao compartilhar:', err);
            window.open(`https://wa.me/?text=${encodeURIComponent(mensagem)}`, '_blank');
        });
    }

    // Utilitários
    function formatLabel(key) {
        const labels = {
            'tipo': 'Tipo de Serviço',
            'data': 'Data',
            'area': 'Área Total (m²)',
            'perfil': 'Perfil',
            'comprimento': 'Comprimento',
            'altura': 'Altura',
            'tipoParede': 'Tipo de Parede',
            'iluminacao': 'Iluminação',
            'tipoMoldura': 'Tipo de Moldura',
            'nome': 'Nome',
            'telefone': 'Telefone',
            'cidade': 'Cidade',
            'observacoes': 'Observações'
        };
        
        return labels[key] || key;
    }

    function formatValue(key, value) {
        if (key === 'data') return value;
        if (typeof value === 'number' && value % 1 !== 0) return parseFloat(value).toFixed(2);
        return value;
    }

    function formatCurrency(value) {
        return 'R$ ' + parseFloat(value).toFixed(2).replace('.', ',');
    }

    function capitalizeFirstLetter(string) {
        return string.charAt(0).toUpperCase() + string.slice(1);
    }

    // Inicializar
    init();
});